import React from "react";



function Testimonio(){
    return(
      <div className='contenido-testimonio'>

        <img
        className='imagen-testimonio'
        src={require('../imagenes/ELVIN-2024.jpeg')}
        alt="foto de emma"
        />

        <div className="contenedor-text-testimonio">
          <p className="nombre-testimonio">elvin morales</p>
          <p className="cargo-testimonio">ingenieria</p>
          <p className="texto-testimonio">ayuda jajajja</p>


        </div>



      </div>
    );
}
